This bootleg has been extracted using CDDAE 99. The audio extraction has been perfect, i.e. without any errors. This is a rare bootleg of the early Pink Floyd featuring Syd Barrett. Please note that the sound quality is extremely lofi. It&amp;#039;s more of a collectors item. The instruments are audible, but the voice is very unclear. I also included some artwork.

I hope you enjoy it!
